import { Link } from "react-router-dom";

const TabLink = ({ icon, pathname, label, location }) => {
    const svgPath = icon ? require(`../assets/${icon}`) : '';

    return(
        <Link to={pathname} className='flex [&:hover>div]:bg-stone-700'> 
            <div className={`font-[22px] flex px-6 py-2 transition ease-out duration-100 rounded-3xl ${location.pathname === pathname && 'font-medium'}`}>
                <img src={svgPath} alt=''/>
                <p className="relative left-2">
                    {label}
                </p>
            </div>
        </Link>
    )
}

export default TabLink;
